--
-- Create procedure `Proc_GetEmployeePaging`
--
CREATE DEFINER = 'dev'@'%'
PROCEDURE Proc_GetEmployeePaging (IN m_Filter varchar(255), IN m_PageIndex int, IN m_PageSize varchar(255), OUT m_TotalRecord int, OUT m_TotalPage int)
COMMENT 'Lấy bản ghi theo phân trang,tìm kiếm'
BEGIN
  -- Lấy dữ liệu theo điều kiện (Lấy theo mã nhân viên hoặc tên có chứa từ khóa)
  CREATE OR REPLACE TABLE tbEmployeeFilter
  SELECT
    ROW_NUMBER() OVER (ORDER BY ve.CreatedDate DESC) AS STT,
    ve.EmployeeId,
    ve.DepartmentName,
    ve.TelephoneNumber,
    ve.EmployeeCode,
    ve.PhoneNumber,
    ve.DepartmentId,
    ve.Email,
    ve.PositionName,
    ve.EmployeeName,
    ve.Gender,
    ve.DateOfBirth,
    ve.IdentityDate,
    ve.IdentityPlace,
    ve.IdentityNumber,
    ve.BankNumber,
    ve.BankBranchName,
    ve.BankName,
    ve.GenderName,
    ve.Address
  FROM View_Employee ve
  WHERE (m_Filter IS NULL)
  OR (ve.EmployeeCode LIKE CONCAT('%', m_Filter, '%')
  OR ve.EmployeeName LIKE CONCAT('%', m_Filter, '%')
  OR ve.TelephoneNumber LIKE CONCAT('%', m_Filter, '%')
  OR ve.PhoneNumber LIKE CONCAT('%', m_Filter, '%'));
  SET @recordStart = (m_PageIndex - 1) * m_PageSize + 1;
  SET @recordEnd = m_PageIndex * m_PageSize;
  SET m_TotalRecord = (SELECT
      COUNT(EmployeeCode)
    FROM tbEmployeeFilter);
  SET @total = (m_TotalRecord % m_PageSize);

  IF (@total > 0
    && @total < 5) THEN
    -- phần thập phân <5 cộng 1 đơn vị 
    SET m_TotalPage = ((m_TotalRecord / m_PageSize) + 1);

  -- Thập phân lớn hơn 5 tự động làm tròn ,nên ko cần cộng thêm 1 đơn vị
  ELSEIF (@total > 5) THEN
    SET m_TotalPage = (m_TotalRecord / m_PageSize);
  ELSE
    SET m_TotalPage = (m_TotalRecord / m_PageSize);
  END IF;
  SELECT
    *
  FROM tbEmployeeFilter
  WHERE STT BETWEEN @recordStart AND @recordEnd;
-- Thực hiện phân trang 
END
$$

DELIMITER ;

